import React from "react";
import { Jumbotron, Container } from "react-bootstrap";

const Hero = () => {
  return (
    <Jumbotron>
      <Container>
        <row>
          <col></col>
        </row>
      </Container>
    </Jumbotron>
  );
};

export default Hero;
